import { makeAutoObservable } from "mobx";

export default class NotesStore {
    constructor() {
        this._types = [
            {id: 1, cat: 'todo'},
            {id: 2, cat: 'buy'}
        ],
        this._notes = [
            {}
        ]

        makeAutoObservable(this)
    }
}
